import React, { useState } from "react";
import "../css/Contact.css";

const Contact = () => {
  const [first, setFirst] = useState("");
  const [second, setSecond] = useState("");
  const [phone, setPhone] = useState("");
  const [email, setEmail] = useState("");
  const [message, setMessage] = useState("");

  handleChange = (event) => {
    setFirst(event.target.value);
    console.log("working right, setting the first name state");
  };

  return (
    <div id="body">
      <div id="form">
        <h3>---Talk to Us---</h3>
        <form action="none">
          <label for="first">First Name</label>
          <input
            type="text"
            placeholder="First Name"
            name="first"
            onChange={handleChange}
          ></input>
          <br />

          <label for="last">Last Name</label>
          <input type="text" placeholder="Last Name" name="last"></input>
          <br />

          <label for="phone">Phone Number</label>
          <input type="tel" placeholder="Phone Number" name="phone"></input>
          <br />

          <label for="email">Email</label>
          <input type="email" placeholder="Email" name="email"></input>
          <br />

          <textarea id="" rows="10" cols="50">
            Your message...
          </textarea>
          <br />

          <button id="button" type="submit" value="submit">
            Send It
          </button>
        </form>
      </div>
    </div>
  );
};

export default Contact;
